    public function addLecteurAction(request $request, $idCommande)
    {      
        $em = $this->getDoctrine()->getManager();
        $data = $request->get('listeLecteur');
        $nbData = count($data);
        $quantite = 0;
        
        $commande = $em->getRepository('ICApprovisionnementBundle:Appro')->getListeLecteurs($idCommande);
        
        foreach($commande[0]->getApproLecteur() as $approLecteur)
        {
            $quantite += $approLecteur->getQuantite();
        }
        
        array_multisort($data['ref'], SORT_ASC, SORT_STRING, $data['numSerie']);
        
        if($quantite == $nbData)
        {
            foreach($commande[0]->getApproLecteur() as $approLecteur)
            {
                $em->remove($approLecteur);
            }
            
            $em->remove($commande[0]);
        }
        else
        {
            $i = 0;
            $tabNblecteur['ref'][$i] = $data['ref'][0];
            $tabNblecteur['nb'][$i] = 0;
            
            foreach ($data['ref'] as $ey => $lecteur)
            {
                if($tabNblecteur['ref'][$i] == $lecteur)
                {
                    $tabNblecteur['nb'][$i]++;
                }
                else
                {
                    $tabNblecteur['ref'][++$i] = $lecteur;
                    $tabNblecteur['nb'][$i] = 1;
                }
            }
            
            foreach ($tabNblecteur['nb'] as $key => $nbLecteur)
            {
                $approLecteurs = $em->getRepository('ICApprovisionnementBundle:ApproLecteur')->findBy(array('idCommande' => $idCommande));
                
                foreach ($approLecteurs as $approLecteur) 
                {
                    if($tabNblecteur['ref'][$key] == $approLecteur->getTypeLecteurAutre()->getReference())
                    {
                         $reste = $approLecteur->getQuantite() - $nbLecteur;
                         
                         if($reste == 0)
                         {
                             $em->remove($approLecteur);
                         }
                         else
                         {
                             $approLecteur->setQuantite($reste);
                             $em->persist($approLecteur);
                         }
                    }
                }
            }
        }
        
        foreach($data['ref'] as $key => $lecteur)
        {
            $typeLecteur = $em->getRepository('ICApprovisionnementBundle:TypeLecteurAutre')->findOneBy(array('reference' => $lecteur));
            $lect = new LecteurAutre();
            
            $lect->setNumSerie($data['numSerie'][$key]);
            $lect->setTypeLecteurAutre($typeLecteur);
            $lect->setDateAjout(new \Datetime());
            $em->persist($lect);
        }
        
        $em->flush();
        
        return new Response(1);
    }
    
    public function approVersStockAutreAction($idCommande)
    {
        $em = $this->getDoctrine()->getManager();
        
        $appro = $em->getRepository('ICApprovisionnementBundle:Appro')->findOneBy(array('id' => $idCommande));
        $approAutre = $em->getRepository('ICApprovisionnementBundle:ApproAutre')->getApproAutreById($idCommande);
       
        $em->remove($appro);
                           
        foreach($approAutre as $aAutre)
        {
            $newQuantite = $aAutre->getAutre()->setQuantite($aAutre->getQuantite() + $aAutre->getAutre()->getQuantite());
            
            $em->persist($newQuantite);
            $em->remove($aAutre);
        }
        
        $em->flush();
        
        return $this->redirectToRoute('ic_approvisionnement_en_cours_autre');
    }
    
